/**
 * Repeats a string n times
 * @param  {int} n Repeats the string n times
 * @return {string} returns the new repeated string
 */
String.prototype.repeat = function(n) {
	return new Array(1 + (n || 0)).join(this);
};

String.prototype.example = function() {
	return '<br><br><span class="blue">' + this + '</span>';
};

String.prototype.replaceAll = function(a, b) {
	var string = this;
	var newString = string.valueOf();
	var x = 0;
	while (string.search(a) >= 0 && x < 100) {
		string = string.replace(a, b);
		x++;
		if (x == 99) {
			alert("You may called the function 'String.replaceAll(a, b)' with the same parameters. break while at defines.js 39");
		}
	}
	return string;
};

String.prototype.getAmount = function(a) {
	var amount = 0;
	var length = this.length;
	var string = this;

	while (string.search(a) >= 0) {
		string = string.replace(a, "");
		amount++;
	}

	return amount;
};

String.prototype.pvalues = function() {
	var ltamount = this.getAmount("&lt;");
	var gtamount = this.getAmount("&gt;");
	var string = this;

	if (ltamount == gtamount && (ltamount + gtamount) > 0) {
		string = string.replaceAll("&lt;", "<<span class='blue'>");
		string = string.replaceAll("&gt;", "</span>>");
	}

	return '<br><br><span class="red">' + string + '</span>';
};

