	/* MOM Command Documentation  * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * */
	this.momAbortDoc = 'This function causes MOM to terminate with an error  message. For example: MOM_abort "Error occurred. Postprocessing has been aborted."' + 'MOM_abort &lt;message&gt;'.pvalues();
	this.momAbortEventDoc = 'This command immediately aborts the current event and returns processing control back to NX.  Use this command if you do not want to return to a calling procedure.' + 'MOM_abort_event &lt;message&gt;'.pvalues();
	this.momAddToAddressBufferDoc = 'Depending on the start/end attribute specified, this extension will add "value(s)" to either the address start buffer or the address end buffer. Each time that this extension is called, it adds to the specified buffer.  When the contents of the address are sent to the output buffer, the contents of the address start buffer will precede it and the contents of the end buffer will go after it.  The address start buffer and the address end buffer are cleared once the they have been sent to the output buffer.' + 'MOM_add_to_address_buffer &lt;address name&gt; &lt;start|end&gt; &lt;value&gt;'.pvalues();
	this.momAddToBlockBufferDoc = 'Depending on the start/end attribute specified, this extension will add "value(s)" to either the block start buffer or the block end buffer. Each time that this extension is called, it adds to the specified buffer.  When the block is sent to the output buffer, the contents of the block start buffer will precede it on the line and the contents of the block end buffer will go after it.  The block start buffer and the block end buffer are cleared once the they have been written to the output buffer.' + 'MOM_add_to_block_buffer &lt;block name&gt; &lt;start|end&gt; &lt;value&gt;'.pvalues();
	this.momAddToLineBufferDoc = 'Depending on the start/end attribute specified, this extension will add "value(s)" to either the line\'s start buffer or the line\'s end buffer. Each time that this extension is called, it adds to the specified buffer.  When the contents of the output buffer are sent to the output file, the contents of the line\'s start buffer will precede it on the line and the contents of the end buffer will go on the same line after it. The line start buffer, line end buffer, and output buffer are all cleared once the they have been written to the output file.' + 'MOM_add_to_line_buffer &lt;start|end&gt; &lt;value&gt;'.pvalues();
	this.momAskAddressValueDoc = 'Always returns the absolute address value NOT the incremental value.' + 'MOM_ask_address_value &lt;address name&gt;'.pvalues();
	this.momAskEnvVarDoc = 'This extension allows you to determine how environment variable "variable name" is set.' + 'MOM_ask_env_var &lt;variable name&gt;'.pvalues();
	this.momAskEventTypeDoc = 'Returns the name of the current event. This is the last event that the event generator executed.';
	this.momAskEssExpValueDoc = 'Provides access to the variables of the NX Expression module, i.e., it returns the value of the NX Expression variable.' + 'MOM_ask_ess_exp_value &lt;variable_name&gt;'.pvalues();
	this.momAskInitJunctionxFormDoc = 'This command returns the transformation matrix of the given Junction (name) at its initial state w.r.t the absolute coordinate system (ACS).' + 'mom_sim_result (matrix: list of 9) & mom_sim_result1 (origin: list of 3)'.pvalues();
	this.momAskMachineZeroJunctionNameDoc = 'This command returns the name of the MACHINE_ZERO Junction.' + 'mom_sim_result'.pvalues();
	this.momAskOperCsysDoc = 'Fetches the CSYS information of the named operation. Passes the results in three mom variables. mom_result represents the mom_special_output of the CSYS. 0 = None, 1 = Use Main MCS, 2 = Fixture Offset, 3 = CSYS Rotation. mom_result1 is a list of 12 doubles containing the mom_csys_matix of the operation CSYS. mom_result2 is a list of 12 doubles containing the mom_machine_csys_matrix of the operation.' + 'MOM_ask_oper_csys &lt;operation-name&gt;'.pvalues();
	this.momAskSyslogNameDoc = 'This command returns the name of syslog file of current session.' + 'String'.pvalues();
	this.momCloseOutputFileDoc = 'This extension allows you to suspend writing output to a particular file until it is opened again' + 'MOM_close_output_file &lt;filename&gt;'.pvalues();
	this.momCheckOutLicenseDoc = 'Obtains Flexlm license until the end of the posting job. &lt;license&gt; is the string name of a valid license. Returns 1 (true) for success or 0 (false) for failure.' + 'MOM_check_out_license &lt;license&gt;'.pvalues();
	this.momConvertPointDoc = 'Converts a point from a tool path position to an MCS position in machine tool coordinates. &lt;point&gt; and &lt;vector&gt; are Tcl arrays of 3. Returns pimary and alternate solutions as Tcl lists of X, Y, Z, 4th, 5th in the variables mom_post_result for the primary and mom_post_result1 for the alternate. ' + 'MOM_convert_point &lt;point&gt; &lt;vector&gt;'.pvalues();
	this.momDisableAddressDoc = 'Suppresses all output for an address.  MOM_force ONCE or MOM_force ALWAYS are ignored while MOM_disable_address is active. MOM_enable_address cancels MOM_disable_address.' + 'MOM_disable_address &lt;Address&gt;'.pvalues();
	this.momDisplayMessageDoc = 'Displays a message dialog box in NX. &lt;type&gt; is the style of the message box, I|E|W|Q, where I is info, E is error, W is warning, and Q is question. Button labels are optional. Returns the number of the button (1, 2, or 3) that the user clicks.' + 'MOM_display_message &lt;message&gt; &lt;title&gt; &lt;type&gt; [&lt;button1&gt;][&lt;button2&gt;][&lt;button3&gt;]'.pvalues();
	this.momDoTemplateDoc = 'Generate output based upon the Block Template "template_name".  BUFFER has the usual meaning. BUFFER will generate the output value for Block Template "template_name" but does not add it to the output buffer, and hence, does not output it to the output file.  CREATE will generate the value for Block Template "template_name" but does not output to the output buffer.  This function returns the string created as the result of the template name.' + 'MOM_do_template &lt;template_name&gt; {BUFFER | CREATE}'.pvalues();
	this.momEnableAddressDoc = 'Restores output status for an address that MOM_disable_address suppressed.  Returns output status to the initial state.' + 'MOM_enable_address &lt;Address&gt;'.pvalues();
	this.momForceDoc = 'The next time that a block template that contains a reference to any of the input address names is evaluated, the word that contains that address will be output regardless of its modality attribute.' + 'MOM_force &lt;Always | Once | Off &gt; &lt;Address_1 ... Address_n&gt;'.pvalues();
	this.momForceBlockDoc = 'Example: MOM_force_block Once linear' + 'MOM_force_block &lt;Always | Once | Off &gt; &lt;Block_1 ... Block_n&gt;'.pvalues();
	this.momIncrementalDoc = 'The next time that a block template that contains a reference to any of the input address names is evaluated, the deference (increment) from the previous value is output.  If ON, then for each Address_i, always output increment.  If OFF, then for each Address_i, always output absolute.' + 'MOM_incremental &lt;ON | OFF&gt; &lt;Address_1 ... Address_n&gt;'.pvalues();
	this.momLoadDefinitionFileDoc = 'This will load the definition file given by filename. If data in filename (or any of its included files) matches data already loaded by previous definition files, the duplicate data is overridden by the new version. Like any TCL extension, this command may be called from any place in the TCL script.' + 'MOM_load_definition_file &lt;filename&gt;'.pvalues();
	this.momLoadLatheThreadCycleParamsDoc = 'This command will load the parameters of a lathe threading cycle of the current operation.  It returns 1 when loading is successful otherwise 0. This command should be called after the desired CSYS is set.' + '0 or 1'.pvalues();
	this.momLogMessageDoc = 'This function causes MOM to write a message to the syslog.' + 'MOM_log_message &lt;message&gt;'.pvalues();
	this.momOnEventErrorDoc = 'If the TCL interpreter reports an error this procedure is invoked prior to raising a system error. The {_debug} procedure is invoked only if DEBUG mode is true.  Example: This procedure is invoked by NX.' + 'MOM_on_event_error {_debug}'.pvalues();
	this.momOnParseErrorDoc = 'If a syntax error is found in the Definition File these procedures are invoked prior to raising a system error. The {_debug} procedure is invoked only if DEBUG mode is true.' + 'MOM_on_parse_error {_debug}'.pvalues();
	this.momOpenOutputFileDoc = 'This extension allows you to redirect output to other output files.  If a file "filename" does not exist, a new one will be created with that file name.' + 'MOM_open_output_file &lt;filename&gt;'.pvalues();
	this.momOutputLiteralDoc = 'Output a list of literals and variables as a single line. If BUFFER is present then only place the string in the output buffer. Do not send it to the output yet.' + 'MOM_output_literal "string" {BUFFER}'.pvalues();
	this.momOutputTextDoc = 'This extension will output a list of literals and variables as a single line, just like MOM_output_literal except that no sequence number will be output. If BUFFER is present then only place the string in the output buffer. Do not send it to the output yet.' + 'MOM_output_text &lt;literal&gt; {BUFFER}'.pvalues();
	this.momOutputToListingDeviceDoc = 'If running in an interactive NX session then output string to the NX listing window, otherwise do nothing.' + 'MOM_output_to_listing_device &lt;"string"&gt;'.pvalues();
	this.momPostOperPathDoc = 'Postprocesses the named operation. The output file argument can be specified without a post; the default post is used. When the file name is given without a preceding path, the primary output directory will be used. When a post is specified, the output file argument SAME outputs to the active output file. Returns 1 (True) when the execution is successful, 0 (False) if it is not successful, and -1 if the post is calling itself. During execution mom_post_oper_path exists and has value 1. The called process uses the same units specifed in the Postprocess dialog box. If a post is named, the review file option and warning output setting are governed by the post that is named.' + 'MOM_post_oper_path &lt;operation-name&gt; [&lt;output file&gt;] [&lt;postprocessor&gt;] [ &lt;event-handler Tcl file&gt; &lt;definition file&gt;]'.pvalues();
	this.momReloadKinematicsDoc = 'Refresh the event generator with the current values of all the kinematics variables.' + 'Integer'.pvalues();
	this.momReloadVariableDoc = 'Update the event generator with the current value of variable_name in the event handler.' + 'MOM_reload_variable [-a] variable_name'.pvalues();
	this.momResetSequenceDoc = 'A sequence is a block template that is output at the beginning of each line. It will typically be used to output sequence numbers but it may also be used to output any block template.' + 'MOM_reset_sequence &lt;start&gt; &lt;increment&gt; {frequency}'.pvalues();
	this.momRunPostprocessDoc = 'Runs a separate post process from within a postprocessor on the same operations or programs that are being postprocessed. Returns 1 (true) when the process execution is successful, 2 (false) if there is an execution error, -1 if the post is calling itself. You can call the same post that is executing, but typically you would use a separate post, such as a turbo post.' + 'MOM_run_postprocess &lt;event-handler Tcl file&gt; &lt;definition file&gt; &lt;output file&gt; current post is calling itself'.pvalues();
	this.momRunUserFunctionDoc = 'This function causes MOM to call the function named entry_point_name in the shared library named shared_library_name. That function can then extend the translator from which MOM_run_user_function was called. It will do this by calling a User Function function named UF_MOM_extend_translator( param, "extension_name", extension_entry_point ). The param will be passed into entry_point_name as the first argument. The signature of entry_point_name is the same as ufusr. The extension_name is the name of the function as it will appear in a TCL script. The extension_entry_point is the actual address of the function to be called by the interpreter when interpreting the extension_name call.' + 'MOM_run_user_function &lt;shared_library_name&gt; &lt;entry_point_name&gt;'.pvalues();
	this.momSetAddressFormatDoc = 'This function redefines the format to be used for the &lt;Address Name&gt; as &lt;Format Name&gt; for outputting in a block. The &lt;Format Name&gt; must be defined in the Definition File.' + 'MOM_set_address_format &lt;Address Name&gt; &lt;Format Name&gt;'.pvalues();
	this.momSetDebugModDoc = 'This will activate, deactivate, and resume the debugger. Like any TCL extension, this command may be called from any place in the TCL script.  If ON, the debugger will activate by initializing with data entered in the debugger dialog or stdout.  If OFF, the debugger will be deactivated.' + 'MOM_set_debug_mode &lt;ON | OFF&gt;'.pvalues();
	this.momSetEnvVarDoc = 'Defines NX environment variables. Both arguments are case sensitive. Only new variables can be set. If you attempt to override pre-existing variables, the command will fail. Variables are unset when post process ends. Returns 1 for success, new variable is created and set. Returns 0 for failure, variable cannot be created - it probably already existed.' + 'MOM_set_env_var &lt;variable name as string&gt;&lt;variable value as string&gt;'.pvalues();
	this.momSetLineLeaderDoc = 'This function causes MOM to set the line leader to a string with the indicated status. A line leader is output as the leading character(s) of the output line (i.e., before the SEQUENCE).' + 'MOM_set_line_leader &lt;Always | Once | Off &gt; &lt;"string"&gt;'.pvalues();
	this.momSetSeqOffDoc = 'Does not output a sequence number. Returns the sequence setting at the time the command is executed.' + 'set current_status [MOM_set_seq_off] ... if { $current_status == "on" } { MOM_set_seq_on }'.pvalues();
	this.momSetSeqOnDoc = 'Allows output of the sequence number if a SEQUENCE specifier was given in the definition file.  Return the sequence setting at the time the command is executed.' + 'set current_status [MOM_set_seq_on]  ... if { $current_status == "off" } { MOM_set_seq_off }'.pvalues();
	this.momSkipHandlerToEventDoc = 'This command will skip the execution of the event handler until the given event is encountered. The condition is reset at the start-of-path and when the event is met. Motion types include Engage, Approach, Firstcut, Retract, Return, Rapid, Cut, Stepover, Departure, Traversal, Sidecut, From, Gohome, and Cycle.' + 'MOM_skip_handler_to_event &lt;event or motion-type&gt;'.pvalues();
	this.momSuppressDoc = 'The next time that a block template that contains a reference to any of the input address names is evaluated, the word that contains the address will not be output regardless of its modality attribute.' + 'MOM_suppress &lt;Always | Once | Off &gt; &lt;Address_1 ... &gt'.pvalues();

    /* * * * * * * * * * * * * * * * * * * * * * LIBRARY Procedures DOCUMENTATION * * * * * * * * * * */
	this.LibGeUiDoc = 'Utility to create UI Nodes/Groups<br>UI structure elements are defined in a CONFIG object like any other property.<br>The CONFIG object is of special type \'UI_TREE\'<br>( LIB_GE_CREATE_obj My_UI_elements {UI_TREE} {....} )<br>To Create the individual UI structure elemets within that CONFIG object you can use this utility.<br>(like this you are able to define a UI element in a single, readable line.<br>the needed Property structure will be generated for you)<br>'+'LIB_GE_ui &lt;name&gt; &lt;type&gt; &lt;id_name&gt; &lt;parent&gt; &lt;sequence&gt; &lt;groupstat&gt; &lt;access&gt;'.pvalues();
	this.LibGeCleanupListDoc = 'This function filters all duplicates from a list and returns the adjusted list.<br>'+'LIB_GE_cleanup_list &lt;list&gt; &lt;newlist&gt; &lt;remove&gt;'.pvalues();
	this.LibGeFormatPathNamesDoc = 'This procedure may be used to format pathnames from unix format in windows<br>format and delete double backslash.<br>'+'LIB_GE_format_path_names &lt;pathname&gt; &lt;exclusion&gt; &lt;forced&gt; &lt;escape&gt;'.pvalues();
